import React from "react";
import Header from "./components/Header/Header";
import "./assets/styles/App.scss";
import Footer from "./components/Footer/Footer";
import Section from "./components/Section/Section";
import Navbar from "./components/Navbar/Navbar";
import FooterGov from "./components/FooterGov/FooterGov";
import { BrowserRouter as Router, Routes, Route, Link, NavLink } from "react-router-dom";
import { faPray } from "@fortawesome/free-solid-svg-icons";
import Formulario from "./components/Formulario/Formulario";


const App = () => {
  return (
    <>

    <Router> {/* Para utilizar router todo se encierra en este */}
      <div className="container">





        <nav className="btn-group">
          <ul>
            <li>
              <Link to="/" className="btn btn-warning">Home</Link>
            </li>
            <li>
              <Link to="/about" className="btn btn-danger">About</Link>
            </li>
            <li>
              <Link to="/users" className="btn btn-dark" activeClassName="active">Users</Link>
            </li>
          </ul>
        </nav>

        <Routes>  
          <Route exact path="/users" element={<Formulario />} />
          <Route exact path="/" element={<section />} />
        </Routes>
      </div>
    </Router>


    <div className="App">
      <Navbar />
      <div className="container">
        <Header />
        <Section />
      </div>
      <Footer />
      <FooterGov />
    </div>
    </>
  );
}

export default App;
